import { 
  Box,
  Typography
} from '@material-ui/core';

import './loading.css';

import { LOADINGCOLOR } from '../color/loading.js';

const Loading = ({
    
}) => {

  return(
    <Box
      display='flex'
      justifyContent='center'
      alignItems='center'
      bgcolor={LOADINGCOLOR}
      height='inherit'
    >
      <Typography
        id='loading-text'
        style={{
          'color': '#E8E8E8',
          'font-size': '50px'
        }}
      >
        LOADING...
      </Typography>
    </Box>
    )
}

export default Loading;
